<!-- HTML for static distribution bundle build -->
<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <title>Swagger UI</title>
    <link rel="stylesheet" type="text/css" href="/assets/swagger-ui.css-731086f9d9a2f48369c36e25ac1d65e2" >
    <link rel="icon" type="image/png" href="/assets/favicon-32x32.png-1b4ded0a3a8df6ef220b4b79f5c10b44" sizes="32x32" />
    <link rel="icon" type="image/png" href="/assets/favicon-16x16.png-3ed02eaf511d24adff466e517d2be705" sizes="16x16" />
    <style>
      html
      {
        box-sizing: border-box;
        overflow: -moz-scrollbars-vertical;
        overflow-y: scroll;
      }

      *,
      *:before,
      *:after
      {
        box-sizing: inherit;
      }

      body
      {
        margin:0;
        background: #fafafa;
      }
    </style>
  </head>

  <body>
    <div id="swagger-ui"></div>

    <script src="/assets/swagger-ui-bundle.js-39ecf62547f8e642583f7a428f2345cc"> </script>
    <script src="/assets/swagger-ui-standalone-preset.js-4d573bac98234b7b3ee8af5b610b34da"> </script>
    <script>
    window.onload = function() {

      // Build a system
      const ui = SwaggerUIBundle({
        url: "/documentation.json",
        dom_id: '#swagger-ui',
        deepLinking: true,
        presets: [
          SwaggerUIBundle.presets.apis,
          SwaggerUIStandalonePreset
        ],
        plugins: [
          SwaggerUIBundle.plugins.DownloadUrl
        ],
        layout: "StandaloneLayout"
      })

      window.ui = ui
    }
  </script>
  </body>
</html>
